  "id_str" : "734080538282065921",
  "in_reply_to_user_id" : 21604764,
  "text" : "Not much about me has changed.",
  "id" : 734080538282065921,
  "in_reply_to_status_id" : 734080458506403841,
  "created_at" : "2016-05-21 17:56:53 +0000",
