  "geo" : { },
  "id_str" : "734080458506403841",
  "in_reply_to_user_id" : 21604764,
  "text" : "As soon as my friends laughed I no longer felt like crying, and the party could begin. I was with my people.",
  "id" : 734080458506403841,
  "in_reply_to_status_id" : 734080265488764928,
  "created_at" : "2016-05-21 17:56:34 +0000",
