  "geo" : { },
  "id_str" : "734080265488764928",
  "in_reply_to_user_id" : 21604764,
  "text" : "Before entering the room, I'd dry my tears, prepare a funny face and a funny noise, march in boisterously, and make a joke.",
  "id" : 734080265488764928,
  "in_reply_to_status_id" : 734080156348735489,
